Select tournament_id, match_number, team_number, alliance, seq_no from team102_2014.load_match_teams
USE team102_2014;

CREATE TABLE `load_match_teams` (
  `tournament_id` varchar(7) NOT NULL DEFAULT '',
  `match_number` decimal(21,0) NOT NULL DEFAULT '0',
  `team_number` int(1) NOT NULL DEFAULT '0',
  `alliance` varchar(4) NOT NULL,
  `seq_no` bigint(22) NOT NULL DEFAULT '0',
  PRIMARY KEY (`tournament_id`,`match_number`,`alliance`,`seq_no`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


